struct segtree {

    vector<long long> tree;
    int size;

    void Init(int n) {
        size = 1;
        while (size < n) {
            size *= 2;
        }
        tree.assign(2 * size - 1, 0);
    }

    void Set(int i, int v, int x, int lx, int rx) {
        if (rx - lx == 1) {
            tree[x] = v;
            return;
        }
        int m = (lx + rx) / 2;
        if (i < m) {
            Set(i, v, 2 * x + 1, lx, m);
        } else {
            Set(i, v, 2 * x + 2, m, rx);
        }
        tree[x] = tree[x * 2 + 1] + tree[2 * x + 2];
    }

    void Set(int i, int v) {
        Set(i, v, 0, 0, size);
    }

    long long Sum(int l, int r, int x, int lx, int rx) {
        if (l >= rx || lx >= r) {
            return 0;
        }
        if (lx >= l && rx <= r) {
            return tree[x];
        }
        int m = (lx + rx) / 2;
        long long s1 = Sum(l, r, 2 * x + 1, lx, m);
        long long s2 = Sum(l, r, 2 * x + 2, m, rx);
        return s1 + s2;
    }

    long long Sum(int l, int r) {
        return Sum(l, r, 0, 0, size);
    }
};

void solve() {
    int n, k, d;
    cin >> n >> k >> d;
    vector<int> a(n + 1);
    for (int i = 1; i <=n; ++i) {
        cin >> a[i];
    }
    sort(a.begin() + 1, a.end());
    a[0] = a[1];

    vector<bool> dp(n + 1, false);
    dp[0] = true;

    segtree st;
    st.Init(n + 1);
    st.Set(0, 1);

    for (int i = 1; i < n + 1; ++i) {
        int r = i - k + 1;
        int l= lower_bound(a.begin(), a.end(), a[i] - d) - a.begin();
//        cout << i << ' ' << l << ' ' << r << endl;
        if (l <= r && l >= 0) {
            --l;
            int sum = st.Sum(l, r);
            if (sum) {
                dp[i] = true;
                st.Set(i, 1);
            }
        }
    }
//    for (int i = 0; i <= n; ++i) {
//        cout << a[i] << ' ';
//    }
//    cout << endl;
//    for (int i = 0; i <= n; ++i) {
//        cout << dp[i] << ' ';
//    }
//    cout << endl;
    if (dp[n]) {
        cout << "YES\n";
    } else {
        cout << "NO\n";
    }
}

