package person

type Person struct {
    name string
    age  int
}

type PersonOption func(*Person)

func WithName(name string) PersonOption {
    return func(p *Person) {
        p.name = name
    }
}

func WithAge(age int) PersonOption {
    return func(p *Person) {
        p.age = age
    }
}

func NewPerson(opts ...PersonOption) *Person {
    p := &Person{}
    for _, opt := range opts {
        opt(p)
    }
    return p
}

