int mod = 1e9 + 7;

void add(int& a, int b) {
    a += b;
    if (a >= mod) {
        a -= mod;
    }
}

int32_t main() {
    ios_base::sync_with_stdio(false);
    int n, m;
    cin >> n >> m;
    vector<string> a(n);
    for (int i = 0; i < n; i++) {
        cin >> a[i];
    }
    vector<vector<int>> dp(n, vector<int>(m));
    dp[0][0] = 1;
    for (int i = 0; i < n; i++) {
        for (int j = 0; j < m; j++) {
            if (i == 0 && j == 0) {
                continue;
            }
            if (a[i][j] == 'X') {
                continue;
            }
            if (i) {
                add(dp[i][j], dp[i - 1][j]);
            }
            if (j) {
                add(dp[i][j], dp[i][j - 1]);
            }
        }
    }
    cout << dp[n - 1][m - 1] << '\n';
}

import numpy as np


def evaluate_measures(sample):
    n_samples = len(sample)
    n_classes = 0
    classes = dict()
    for c in sample:
        if c in classes:
            classes[c] += 1
        else:
            classes[c] = 1
            n_classes += 1
    probs = np.zeros(n_classes)
    for i, c in zip(range(n_classes), classes):
        probs[i] = classes[c] / n_samples
    gini = 1
    entropy = 0
    error = 1
    for p in probs:
        gini -= p * p
        entropy -= p * np.log(p)
        error = min(error, 1 - p)
    measures = {'gini': gini, 'entropy': entropy, 'error': error}
    return measures

